import { useNavigate } from "react-router-dom";

export default function Dashboard() {
  const navigate = useNavigate();

  return (
    <div style={{ textAlign: "center", marginTop: 60 }}>
      <h2>¡Hola! Elige una opción:</h2>
      <button onClick={() => navigate("/plants")}>Mis plantas</button><br />
      <button onClick={() => navigate("/reminders")}>Recordatorios</button><br />
      <button onClick={() => navigate("/community")}>Comunidad</button><br />
      <button onClick={() => navigate("/PlantSeach")}>Buscador de Plantas</button><br />
      <button onClick={() => navigate("/support")}>Soporte</button><br />
    </div>
  );
}
